// import logo from './logo.svg';
import "./App.css";

function App() {
  return (
    <main>
      <article>
        <h1>Hamburger App</h1>
        <span>Wake Up at 08:00 </span>
        <span>Clean My room 3h </span>
        <span>Do My homework 3h 20m </span>
        <span>Test comment 2h 1m </span>
        <span>Sleep at 01:00 </span>
      </article>
    </main>
  );
}

export default App;
